import React, { Component } from "react";
import { ListItem, ListInfo } from "../style";

class List extends Component {
  render() {
    return (
      <div>
        <ListItem>
          <img
            src="https://oimagec2.ydstatic.com/image?id=-9097724867551114430&product=adpublish&w=300&h=200&sc=0&rm=2&gsb=0&gsbd=60"
            className="pic"
          />
          <ListInfo>
            <h3 className="title">从Python开学，构建你的神经网络！</h3>
            <p className="desc">小班辅导，一站式掌握AI红利！立抢限量席位！</p>
          </ListInfo>
        </ListItem>
      </div>
    );
  }
}

export default List;
